import React, { useEffect, useState } from 'react';
import {LoginCredentialsAndQueries} from '../Services/loginCredentialsAndQueries';
import './AppListDropdown.css';  // You may want to create a CSS file for styling

const AppListDropdown = (props) => {
  const [isDropdownOpen, setDropdownOpen] = useState(false);
  console.log(props);
const [accessToken,setAccessToken]=useState();
setAccessToken(LoginCredentialsAndQueries);
  useEffect(()=>{
    const fetchPlantsData = async () => {
      accessToken
      const plantsResponse = await fetch(`https://api.infinite-uptime.com/api/3.0/idap-api/application-user/subscribed-apps?emailId=rapaka.chandrashekar%40gmail.com`, {
            method: 'GET',
            headers: {
              'accept': 'application/json',
              'Authorization': 'Bearer ' + accessToken,
            },
          });

          if (plantsResponse.status === 401) {
           let apicallstatus = false;
            // Stop further API calls
           // clearInterval(intervalId);
            //console.log("apicallstatus: " + apicallstatus);
            return [[]],apicallstatus;
          }
          const plantsData = await plantsResponse.json();
    }
    fetchPlantsData();
  },[])
  if(props.displayApps!=undefined ){
    if(props.displayApps.length>0){
  props.displayApps.forEach(element => {
    return(
    <li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src={element.display_value}/>
					<span>DRS</span>
				</a>
			</li>
    )
  
    
  });
}
}
  const toggleDropdown = () => {
    setDropdownOpen(!isDropdownOpen);
  };
  return (
  
    <div className="app-list-dropdown-wrap">
      <a href="javascript:void(0)" className="app-list-trigger" onClick={toggleDropdown}>
        <img alt="" src="data:image/png;base64," />
      </a>
      <div className={`app-list-dropdown ${isDropdownOpen ? 'open' : ''}`}>
      <ul class="app-list-items">
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/SupportIcon.png" />
					<span>IDAP Support</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/DrsIcon.png" />
					<span>DRS</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/DaasIcon.png" />
					<span>DaaS</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/SmartViewIcon.png" />
					<span>SmartView</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/ProcessInsightsIcon.png" />
					<span>Process Insights</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/ProductionInsightsIcon.png" />
					<span>Production Insights</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/AdminServiceIcon.png" />
					<span>Admin Service</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/CommunityHubIcon.png" />
					<span>Community Hub</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/CrvIcon.png" />
					<span>Control Room View</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/Nitty+Icon.png" />
					<span>Nity</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/PlantSummaryIcon.png" />
					<span>Plant Summary</span>
				</a>
			</li>
			<li class="app-list-item">
				<a class="app-list-link" href="#">
					<img alt="" src="https://idap-plantos.s3.ap-south-1.amazonaws.com/english/logos/CbmIcon.png" />
					<span>CBM</span>
				</a>
			</li>
		</ul>
        <a className="app-list-btn" href="#">
          PlantOS App Suite
        </a>
      </div>
    </div>
  );
};

export default AppListDropdown;
